import "../styles/Landing.css";

const Landing = () => {
  return (
    <div
      className="landing-container"
      style={{
        backgroundImage: `url(${process.env.PUBLIC_URL}/images/robot-eye.png)`
      }}
    >
      <div className="welcome-card">
        <h1 className="system-title">AURA Monitor</h1>
        <p className="system-description">
          Intelligent AI system for real-time student attention monitoring
        </p>
        <button className="start-btn">Start Monitoring</button>
      </div>
    </div>
  );
};

export default Landing;
